import { SkillBars } from "react-skills";

const skillsData = [
  {
    name: "ReactJS",
    level: 65,
    color: "blue",
    height: 20,
  },
  {
    name: "JavaScript",
    level: 85,
    color: "green",
  },
];

// ...
function Skills() {
  return <SkillBars skills={skillsData} />;
}

export default Skills;
